(5663,259,'2017-04-06','a supremacia de Cristo e a revelação de poder apartir da crucificação e e ressurreição.',NULL,'Revelação na crucificação e ressurreição','2017-04-07 00:08:09'),(5664,259,'2017-04-13','João apresenta a ideia de pano de fundo que é a revelação da Pessoa,  o objeto da revelação é o próprio Deus.',NULL,'A revelação no Evangelho de João','2017-04-14 00:03:28'),(5665,259,'2017-04-20','Reposição da aula. Aspectos do Mistério da pregação de Apostolo.  ',NULL,'Aula que foi dada no dia 08 de Maio','2017-05-08 23:34:17'),(5666,259,'2017-04-27','',NULL,'Semana teologica','2017-05-05 01:02:13'),(5667,259,'2017-05-04','A plenitude dos tempos traz consigo a realização completa do plano de Deus. \r\n',NULL,'A plenitude dos Tempos','2017-05-05 01:05:59'),(5668,259,'2017-05-11','A cristologia de  Paulo é uma cristologia de fatos redentores. A morte e ressurreição de Jesus sustentam sua pregação.\r\n',NULL,'Aula dada 12.05 ','2017-05-12 23:38:59'),(5669,259,'2017-05-18','Cristo é designado Inaugurador da nova humanidade. Mais uma vez é sua ressurreição dos mortos que faz dele esse último Adão.\r\nComo segundo Homem e último Adão, Cristo é aquele em cuja ressurreição essa nova vida  de recriação já veio a luz e tornou-se realidade nessa dispensação. \r\n',NULL,'O Primogênito dos Mortos.','2017-05-19 01:02:10'),(5670,259,'2017-05-25','Este é um dos temas mais típicos da pregação de Paulo.\r\nEle está relacionado intimamente ao tema anterior da figura de Cristo como último Adão, inaugurador da nova humanidade. Por esse motivo iremos mais a fundo nesse relacionamento, pois faz parte da estrutura fundamental do pensamento do Apóstolo Paulo.\r\n',NULL,'Em Cristo. ','2017-05-26 00:19:00'),(5671,259,'2017-06-01','A importância da correta compreensão dos termos \"em Cristo, com Cristo\" na estrutura do pesanamento do Apostolo Paulo.',NULL,'Com Cristo - Velho Homem novo Homem','2017-06-02 01:15:15'),(5672,259,'2017-06-08','A ressurreição de Cristo foi mostrada como sendo o início da nova criação. Naturalmente surge a questão sobre qual é o significado que deve ser atribuído à vida de Cristo na terra antes de sua morte e ressurreição. \r\n',NULL,'Dicotomia carne e espirito','2017-06-08 22:33:57'),(5673,259,'2017-06-15','',NULL,'Feriado ','2017-06-22 21:19:56'),(5674,259,'2017-06-22','A TEOLOGIA DO APÓSTOLO PAULO PARTE SEMPRE DA MORTE E RESSURREIÇÃO DE CRISTO E DE QUALQUER PONTO TRAÇADO COM VISTAS A UNIR ESSES DOIS ASSUNTOS.\r\nNO ENTANTO A ÍNTEGRA DE SUA PREGAÇÃO REPOUSA NA REVELAÇÃO FUTURA E HISTÓRICA DE CRISTO É APOIADA PELA CONFISSÃO DE CRISTO COMO O FILHO DE DEUS, E SUA SEMELHANÇA, NO SENTIDO SUPRA E PRÉ HISTÓRICO DA PALAVRA. \r\n',NULL,'Filho de Deus. Imagem e semelhança de Deus','2017-06-23 00:23:09'),(5675,259,'2017-06-29','O Espirito pode ser identificado com Cristo de várias maneiras, pois é no advento e na obra de Cristo que a obra do espírito se manifesta, como aquele que realiza e impulsiona rumo a consumação. \r\n',NULL,'Parousia. O Cristo exaltado ','2017-06-30 00:07:58'),(5676,NULL,NULL,'',NULL,'','2017-03-03 00:21:46'),(5677,NULL,NULL,'',NULL,'','2017-03-07 12:06:50'),(5678,NULL,NULL,'',NULL,'','2017-03-16 17:41:25'),(5679,NULL,NULL,'',NULL,'Aula dada','2017-04-19 22:19:48'),(5680,NULL,NULL,'',NULL,'Aula dada','2017-05-15 12:46:51'),(5681,NULL,NULL,'',NULL,'','2017-06-29 20:21:23'),(5682,260,'2017-07-25','Conteúdo Programático, introdução',NULL,'AULA 1','2017-07-25 22:40:39'),(5683,260,'2017-08-01','Os patriarcas',NULL,'AULA 2','2017-08-01 23:42:19'),(5684,260,'2017-08-08','',NULL,'SEMANA TEOLÓGICA','2017-08-15 22:44:43'),(5685,260,'2017-08-15','O Egito e o Exodo',NULL,'AULA 2','2017-08-15 22:45:56'),(5686,260,'2017-08-22','A conquista da terra',NULL,'AULA 3','2017-08-30 00:04:27'),(5687,260,'2017-08-29','O reino unido',NULL,'AULA 4','2017-08-30 00:05:04'),(5688,260,'2017-09-05','Reino unido',NULL,'aula 5','2017-09-05 22:37:35'),(5689,260,'2017-09-12','',NULL,'Professor ausente','2017-09-19 23:04:47'),(5690,260,'2017