ssimas exceções o rejeitaram. Alguns até planejaram sua morte.\r\nMarcos deixa claro que Jesus ressuscitaria dos mortos, mas as primeiras pessoas que descobrem fogem atemorizadas, e não dizem nada a ninguém.\r\nE dessa forma estranha o evangelho de Marcos chega ao fim.\r\nO QUE TEM DE BOAS NOVAS NISSO?\r\n',NULL,'Marcos - A morte do filho de Deus como boas novas.','2017-09-02 00:21:04'),(6328,291,'2017-09-08','EMENDA DO FERIADO. ',NULL,'ALUNO NÃO COMPARECEU','2017-09-15 18:55:26'),(6329,291,'2017-09-15','Lucas oferece a seus leitores uma declaração explícita do propósito de sua obra em dois volumes: “para que tenhais a certeza das coisas que te foram ensinadas” Lc 1.4.\r\n',NULL,'Lucas-Atos. O lugar dos cristãos no curso da história da Salvação  ','2017-09-22 18:32:46'),(6330,291,'2017-09-22','DO MESMO MODO QUE ESTRUTURA MAIOR APÓIA A INTERPRETAÇÃO DA FILIAÇÃO DIVINA DE JESUS COMO SUA UNIDADE COM O PAI, O DIALOGO NO EVANGELHO LEVA O LEITOR DA EXPLICAÇÃO DO PAPEL DE JESUS SEGUNDO AS CATEGORIAS TRADICIONAIS À DESCRIÇÃO EXALTADA DE SUA UNIDADE COM DEUS NO PRÓLOGO DO EVANGELHO.',NULL,'JOÃO - FÉ EM JESUS COMO MEIO PARA A VIDA ETERNA','2017-09-22 18:48:15'),(6331,291,'2017-09-29','Mateus, Marcos, Lucas-Atos e João foram escritos em quatro ambientes distintos por autores diferentes, e cada um possui um conjunto próprio de questões teológicas.\r\n',NULL,'QUATRO TESTEMUNHAS DIFERENTES  DO EVANGELHO ÚNICO DE JESUS CRISTO','2017-09-29 23:22:38'),(6332,291,'2017-10-06','',NULL,'O aluno faltou','2017-10-13 22:55:18'),(6333,291,'2017-10-13','No campo da teologia do NT, talvez o subtópico mais veementemente debatido seja a teologia paulina. Parte da causa dessa controvérsia é o fato de Paulo oferecer mais informações a respeito de suas convicções teológicas permanentes que qualquer outro autor do NT.\r\n',NULL,'O CERNE DA TEOLOGIA DE PAULO','2017-10-13 22:56:50'),(6334,291,'2017-10-20','Manutenção da fé, da esperança e do amor. ',NULL,'Cartas Paulinas - Tessalonicenses  ','2017-10